import functools


class Solution:
    def longestDupSubstring(self, S):

        # Construct suffix array.
        suffix_array = list(range(len(S)))
        suffix_array.sort(key=lambda i: S[i:])


        @functools.cache
        def lcp(i, j):
            """Return the longest common prefix starting at i and j."""
            if i < len(S) and j < len(S) and S[i] == S[j]:
                return 1 + lcp(i+1, j+1)
            return 0


        # Use suffix array to find longest duplicate substring.
        start_index, soln_length = 0, 0
        for i, j in zip(suffix_array[:-1], suffix_array[1:]):
            # Use the memoized lcp function to get the longest common
            # prefix between the two suffixes.
            k = lcp(i, j)
            if k > soln_length:
                start_index, soln_length = i, k

        if soln_length > 0:
            return S[start_index:start_index+k+1]
        return ""


def test_1():
    S = "banana"
    expected = "ana"
    assert Solution().longestDupSubstring(S) == expected


def test_2():
    S = "abcd"
    expected = ""
    assert Solution().longestDupSubstring(S) == expected


def test_3():
    """TLE"""
    S = "a" * pow(10, 4) * 3
    expected = "a" * ((pow(10, 4) * 3) - 1)
    result = Solution().longestDupSubstring(S)
    assert result == expected


